function ActorConfigurationPage() {
    /**
     *
     */
    ActorConfigurationPage.prototype.initialize = function (console, actor) {
        this.id = "actorConfiguration";
        this.console = console;
        this.actor = actor;

        return this;
    };

    /**
     *
     */
    ActorConfigurationPage.prototype.show = function () {
        var deferred = $.Deferred();

        deferred.resolve();

        return deferred.promise();
    };

    /**
     *
     */
    ActorConfigurationPage.prototype.leave = function () {
    };
}
